    function mapProviderToPrice(priceList, isStateActive, key) {
      const type = key.split('_')[0];
      const providerPriceList = [];

      priceList.forEach((item, index) => {
        let price = null;
        if (item === 0 && isStateActive === false) {
          const defaultPrice = config[type];
          price = defaultPrice[index] / 100;
        }
        else if (item !== 0) {
          price = item / 100;
        }
        const providerKey = config.insurance_providers[index];
        providerPriceList.push({ key: providerKey, value: price });
      });
      return providerPriceList;
    }

